import React from 'react'
import { useDadosContext } from '../../context/Dados'
import styles from './DadosPessoais.module.css'

export default function DadosPessoais() {
    const {dados} = useDadosContext();
  return (
    <div>
        <p>{dados.nome}</p>
        <p>{dados.sobrenome}</p>
        <p>{dados.cpf}</p>
        <p>{dados.email}</p>
    </div>
  )
}
